import React from 'react'
import Form from 'react-bootstrap/Form'

function Check(props) {
    return (
        <Form.Group controlId='check-1'>
            <Form.Label>{props.label}</Form.Label>
            {
                props.data.map(item => (
                    <Form.Check
                        type={item.type}
                        id={item.id}
                        label={item.label}
                        name={props.name}
                    />
                ))
            }
        </Form.Group>
    );
}

export default Check;
